import { UserResDto } from '../../models/dto/user/user.res.dto';
import { UserReqDto } from '../../models/dto/user/user.req.dto';
import { AvatarModule } from 'primeng/avatar';
import { AvatarGroupModule } from 'primeng/avatargroup';


@Component({
  selector: 'app-users',
  standalone: true,
  imports: [
    CommonModule,
    TableModule,
    ToastModule,
    TagModule,
    DropdownModule,
    ButtonModule,
    InputTextModule,
    RippleModule,
    FormsModule,
    RouterModule,
    ReactiveFormsModule,
    AvatarModule,
    AvatarGroupModule,
  ],
  templateUrl: './users.component.html',
  styleUrls: ['./users.component.css'],
  providers: [MessageService]
})
export class UsersComponent {

  @ViewChild('fileInput') fileInput!: ElementRef;

  isEditing = false;

  isHovered = false;

  // fileContent: string = '';
  // fileExtension: string = '';

  userForm = this.formBuilder.group({
    id: ['', [Validators.required]],
    userName: ['', [Validators.required]],
    email: ['', [Validators.required, Validators.email]],
    phoneNumber: [''],
    roleName: ['', [Validators.required]],
    fileContent: [''],
    fileExtension: [''],
  });

  get isEditingUser() { return this.isEditing }

  users: UserResDto[] = [
    {
      id: "3b9f47cf-2748-4632-b384-eb0c62b74f21",
      userName: "Lisa",
      email: "lisa@gmail.com",
      phoneNumber: "03939",
      roleName: "Super Admin",
      fileContent: '',
      fileExtension: '.png',
    },
    {
      id: "df035893-2413-4bf6-9dfe-0e1dd4855169",
      userName: "Budi",
      email: "budi@gmail.com",
      phoneNumber: "03938",
      roleName: "Payroll Service",
      fileContent: '',
      fileExtension: '.png',
    },
    {
      id: "b247e0bf-669a-4b54-8c9a-42a9523e326d",
      userName: "Bambang",
      email: "bambang@gmail.com",
      phoneNumber: "03937",
      roleName: "Client",
      fileContent: '',
      fileExtension: '.png',
    },
    {
      id: "18a30c17-24f6-4f2b-942d-7b7dcd039559",
      userName: "Dule",
      email: "dule@gmail.com",
      phoneNumber: "03936",
      roleName: "Client",
      fileContent: '',
      fileExtension: '.png',
    },
  ]

  clonedUsers: { [s: string]: UserResDto } = {};

  roles!: SelectItem[];

  constructor(
    private messageService: MessageService,
    private formBuilder: NonNullableFormBuilder,
  ) { }

  ngOnInit() {
    this.roles = [
      { label: RoleType.RL001, value: RoleType.RL001 },
      { label: RoleType.RL002, value: RoleType.RL002 },
      { label: RoleType.RL003, value: RoleType.RL003 }
    ];
  }

  generateImage(contentData: string, extension: string): string {
    return `data:image/${extension};base64,${contentData}`;
  }

  onCreateClick() {
    // Handle create click
  }

  onRowEditInit(user: UserResDto) {
    this.clonedUsers[user.id as string] = { ...user };
    this.isEditing = true;
    this.userForm.patchValue(user);
  }

  onRowEditSave(user: UserResDto) {
    const userReqDto: UserReqDto = this.userForm.getRawValue();
    // Save user logic here
    this.messageService.add({ severity: 'success', summary: 'Success', detail: `User is updated` });
    this.isEditing = false;
  }

  onRowEditCancel(user: UserResDto, index: number) {
    this.users[index] = this.clonedUsers[user.id as string];
    delete this.clonedUsers[user.id as string];
    this.userForm.reset();
    this.isEditing = false;
  }

  onSubmit() {
    // Handle form submission
  }

  onAlert() {
    alert('bjir')
  }

  onAvatarClick(): void {
    this.fileInput.nativeElement.click();
  }

  onFileSelected(event: Event): void {
    const input = event.target as HTMLInputElement;
    if (input.files && input.files[0]) {
      const file = input.files[0];
      const reader = new FileReader();

      reader.onload = () => {
        const base64 = (reader.result as string).split(',')[1];
        this.userForm.patchValue({ fileContent: base64, fileExtension: file.type.split('/')[1] })
        // this.fileContent = base64;
        // this.fileExtension = file.type.split('/')[1];
      };

      reader.readAsDataURL(file);
    }
  }
}
